import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom';

export const Login = () => {

    let iniciarSesion = useNavigate();
    

    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (event) => {

        event.preventDefault(); 

        iniciarSesion = ('/Clientes');

        console.log('Login submitted with username:', username, 'and password:', password);
        console.log(iniciarSesion);
    };

    return (
        <form onSubmit={handleSubmit}>

            <div>
                <label htmlFor="username">Usuario:</label>
                <input
                    id="username"
                    type="text"
                    value={username}
                    onChange={e => setUsername(e.target.value)} // Actualiza el estado al cambiar el contenido del input
                />
            </div>

            <div>
                <label htmlFor="password">Contraseña:</label>
                <input
                    id="password"
                    type="password"
                    value={password}
                    onChange={e => setPassword(e.target.value)} // Actualiza el estado al cambiar el contenido del input
                />
            </div>
            
            <button type="submit">Iniciar sesión</button>
        </form>
    );

}
